// This is the Link API
import Link from "next/link";

const Pricing = () => (
  <div className="pricing-body">
    <h1>Pricing</h1>
    <style global jsx>{`
      .pricing-body {
        height: 1000vh;
        width: 100vw;
        background-image: linear-gradient(90deg, #150d2b, #242351);
        margin: 0;
      }
    `}</style>
  </div>
);

export default Pricing;
